import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const history = useNavigate();

  const handleSignUp = () => {
    history.push('/signup');
  };

  const handleLogin = () => {
    history.push('/login');
  };

  return (
    <div className="landing-page flex w-vw h-dvh">
      <div className="w-3/5 bg-gray-500">
        <img src=""></img>
      </div>
      <div className="flex flex-col h-full items-center justify-center w-2/5">
        <h1 className="text-6xl">Delphi</h1>
        <p>AI Literature Assistant</p>
        <button className="ml-4 px-4 py-2 bg-indigo-500 text-white rounded-3xl hover:bg-indigo-60" onClick={handleSignUp}>Sign Up</button>
        <button className="ml-4 px-4 py-2 text-indigo-500 b-indigo-500 rounded-3xl hover:bg-indigo-60" onClick={handleLogin}>Login</button>
      </div>

    </div>
  );
};

export default LandingPage;
